import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAlignCenter, faCoffee, faDisplay, faFaceMehBlank, faImage, faPerson } from '@fortawesome/free-solid-svg-icons';
import logo from '../../logo.svg';
import './Home.css';

