        <h1>Welcome to ProjectVault</h1>
        <p>Explore the perfect projects for your acedamic requirements, with all source codes, reports, included</p>
        <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="dropdown1">Dropdown 1:</label>
